import React from 'react';

const inferText = ({inference}) => {
    if ({inference} === true) {
        var text = "This food is okay to eat!"
    }
    else{
        var text = "This food is not okay to eat considering your High Blood Pressure! Please Avoid it!"
    }

    return (
        <div className = "center">
            <h2> {text} </h2>

        </div>
    );
}

export default inferText;
